import React from "react";

const Profilemini = () => {
  return (
    <>
      <div className="card w-[30rem] bg-base-100 shadow-xl">
        <figure className="px-10 pt-10 flex-col gap-2">
          <img
            src={require("../../assets/images/christopher-campbell.jpg")}
            alt="Shoes"
            className="rounded-full w-[10rem] h-[10rem]"
          />
          <input
            type="file"
            className="bg-pale"
          />
        </figure>
        <div className="card-body items-center text-center">
          <h2 className="card-title">Christopher</h2>
          <h3>Web Developer</h3>
          <div className="card-actions flex-col">
            <button className="btn btn-primary">Ubah Password</button>
            <button className="btn btn-primary  outline-none">Kembali</button>
          </div>
        </div>
      </div>
    </>
  );
};

export default Profilemini;
